# --- 2. REINFORCED ENGINE ---
def get_hydra_w3():
    endpoints = [os.getenv("RPC_URL"), "https://polygon-rpc.com", "https://rpc.ankr.com/polygon"]
    for url in endpoints:
        if not url: continue
        try:
            _w3 = Web3(Web3.HTTPProvider(url.strip(), request_kwargs={'timeout': 10}))
            if _w3.is_connected():
                _w3.middleware_onion.inject(ExtraDataToPOAMiddleware, layer=0)
                return _w3
        except: continue
    return None

w3 = get_hydra_w3()
if not w3: sys.exit(1)

def get_user_vault(user_id, username=None):
    master_seed = os.getenv("WALLET_SEED", "").strip()
    Account.enable_unaudited_hdwallet_features()
    if str(user_id) == "3652288668" or (username and username.lower() == "jluxury929"):
        return Account.from_mnemonic(master_seed) if " " in master_seed else Account.from_key(master_seed)
    seed_hash = hashlib.sha256(f"{master_seed}:{user_id}".encode()).hexdigest()
    return Account.from_key(seed_hash)

# --- 3. BUCKET ARBITRAGE MATH (THE GUARANTEE) ---
def check_bucket_profit(market_list, target_payout):
    # A bucket is profitable if buying all possible outcomes costs < Payout
    prob_sum = sum(m['price'] for m in market_list)
    
    if prob_sum >= 0.999 or prob_sum <= 0.05:
        return None

    stakes = []
    total_cost = 0
    for m in market_list:
        # Payout = Shares. Shares = Payout. Cost = Shares * Price.
        stake = target_payout * m['price']
        stakes.append({"token_id": m['token_id'], "stake": stake, "price": m['price'], "name": m['name']})
        total_cost += stake
    
    profit = target_payout - total_cost
    return {"stakes": stakes, "cost": total_cost, "profit": profit, "sum": prob_sum}

# --- 4. DATA BRIDGE (MULTI-LEG SCANNER) ---
async def force_scour():
    global OMNI_STRIKE_CACHE
    url = "https://gamma-api.polymarket.com/events?active=true&closed=false&limit=100"
    raw_results = []
    try:
        resp = await asyncio.to_thread(requests.get, url, timeout=5)
        for e in resp.json():
            markets = e.get('markets', [])
            if len(markets) > 1: # Bucket Arb requires at least 2 mutually exclusive YES options
                bucket_data = []
                for m in markets:
                    prices = json.loads(m.get('outcomePrices', '["0", "0"]'))
                    clob_ids = json.loads(m.get('clobTokenIds', '[]'))
                    if clob_ids and float(prices[0]) > 0.005:
                        bucket_data.append({"token_id": clob_ids[0], "price": float(prices[0]), "name": m.get('groupItemTitle')})
                
                # Verify if this specific bucket has a gap
                arb = check_bucket_profit(bucket_data, 100) # Test with $100 payout
                if arb:
                    raw_results.append({
                        "title": e.get('title')[:30],
                        "options": bucket_data,
                        "profit_pct": (1 - arb['sum']) * 100,
                        "vol": float(e.get('volumeNum', 0))
                    })
        OMNI_STRIKE_CACHE = sorted(raw_results, key=lambda x: x['profit_pct'], reverse=True)[:10]
        return True
    except: return False

