async def handle_query(update, context):
    q = update.callback_query; await q.answer()
    v = get_user_vault(q.from_user.id, q.from_user.username)
    
    if "SET_" in q.data:
        val = int(q.data.split("_")[1]); context.user_data['payout'] = val
        await q.edit_message_text(f"‚úÖ <b>RETURN TARGET: ${val}</b>")
    
    elif "INT_" in q.data:
        idx = int(q.data.split("_")[1]); target = OMNI_STRIKE_CACHE[idx]
        payout = context.user_data.get('payout', 100)
        arb = check_bucket_profit(target['options'], payout)
        
        context.user_data['current_arb'] = arb
        
        desc = (f"‚öñÔ∏è <b>BUCKET ANALYSIS</b>\n"
                f"<b>Outcomes:</b> {len(arb['stakes'])}\n"
                f"<b>Total Risk:</b> ${arb['cost']:.2f}\n"
                f"<b>Guaranteed Profit:</b> +${arb['profit']:.2f}")
        
        await q.edit_message_text(desc, reply_markup=InlineKeyboardMarkup([[InlineKeyboardButton("üí• CONFIRM BUCKET SWEEP", callback_data=f"EXE_{idx}")]]), parse_mode='HTML')

    elif "EXE_" in q.data:
        arb = context.user_data['current_arb']
        m_proc = await context.bot.send_message(q.message.chat_id, "üëÅÔ∏è <b>EXECUTING BUCKET SWEEP...</b>")
        try:
            client = ClobClient(host="https://clob.polymarket.com", key=v.key.hex(), chain_id=137, signature_type=0, funder=v.address)
            client.set_api_creds(client.create_or_derive_api_creds())
            
            # Atomic Sweep: Place orders for every outcome in the bucket
            for item in arb['stakes']:
                args = MarketOrderArgs(token_id=str(item['token_id']), amount=item['stake'], side=BUY, price=0.999)
                signed = await asyncio.to_thread(client.create_order, args)
                await asyncio.to_thread(client.post_order, signed, OrderType.FOK)
            
            await m_proc.edit_text(f"üöÄ <b>STRIKE SUCCESSFUL.</b>\nLocked in ${arb['profit']:.2f} guaranteed.")
        except Exception as e: await m_proc.edit_text(f"‚ö†Ô∏è <b>ERROR:</b> {str(e)[:50]}")

